import React from 'react';
import Title from './../title';

import './styles.css'

const Contact = (props) => {
    return (
        <>
            <div className="contact">
                <Title title="Entre em contato comigo" />
                <div className="container">
                    <div className="row">                
                        <a className="whatsapp-button">
                            Me chame no WhatsApp
                        </a>
                    </div>
                </div>  
            </div>
        </>
    );
}

export default Contact;
